import React from "react";


function KanjiHeader() {
    return (
        <header className="header-contact">
            <h2 className="contact-en">KANJI</h2>
            <h3 className="contact-ja" lang="ja">漢字</h3>
        </header>
    );
}

export default KanjiHeader;
